// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@chainlink/contracts/src/v0.8/ConfirmedOwner.sol";

interface IDAO {
  struct Premium {
      address subscriber;
      string flightNumber;
      uint256 amount;
      uint256 price;
      uint256 validUntil;
      bool contracted;
      bool refunded;
  }
  struct Subscription {
      address subscriber;
      uint256 premiumId;
  }
  function setPremiumPrice(uint256 _premiumID, uint256 _price) external;
  function setStatus(string calldata _flightNumber, bool _canceled) external;
}

contract Oracle is ChainlinkClient, ConfirmedOwner {
    using Chainlink for Chainlink.Request;

    bytes32 private jobIdGetUint256;
    bytes32 private jobIdGetBool;
    uint256 private fee;

    struct Request {
      address fromAddress;
      uint256 fromID;
      string fromFlightNumber;
      uint256 fromAmount;
    }
    mapping(bytes32 => Request) requests;

    /**
     * @notice Initialize the link token and target oracle
     *
     * Goerli Testnet details:
     * Link Token: 0x326C977E6efc84E512bB9C30f76E30c160eD06FB
     * Oracle: 0xCC79157eb46F5624204f47AB42b3906cAA40eaB7 (Chainlink DevRel)
     * jobIdGetUint256: ca98366cc7314957b8c012c72f05aeeb
     * jobIdGetBool: ca98366cc7314957b8c012c72f05aeeb
     *
     */
    constructor() ConfirmedOwner(msg.sender) {
        setChainlinkToken(0x326C977E6efc84E512bB9C30f76E30c160eD06FB);
        setChainlinkOracle(0xCC79157eb46F5624204f47AB42b3906cAA40eaB7);
        jobIdGetUint256 = "ca98366cc7314957b8c012c72f05aeeb";
        jobIdGetBool = "c1c5e92880894eb6b27d3cae19670aa3";
        fee = (1 * LINK_DIVISIBILITY) / 10; // 0,1 * 10**18 (Varies by network and job)
    }

    function requestRisk(uint256 _fromID, string calldata _flightNumber, uint256 _amount) public returns (bytes32 requestId) {
        Chainlink.Request memory req = buildChainlinkRequest(jobIdGetUint256, address(this), this.fulfillRisk.selector);

        req.add("get", string.concat("https://api.flights.gabou.cool/flights/flightNumber?flightNumber=", _flightNumber));
        req.add("path", "risk");
        req.addInt("times", 1);

        bytes32 reqId = sendChainlinkRequest(req, fee);

        Request storage request = requests[reqId];
        request.fromAddress = msg.sender;
        request.fromID = _fromID;
        request.fromFlightNumber = _flightNumber;
        request.fromAmount = _amount;

        return reqId;
    }

    function fulfillRisk(bytes32 _requestId, uint256 _risk) public recordChainlinkFulfillment(_requestId) {
        if(_risk > 0) {
          Request memory request = requests[_requestId];
          IDAO(request.fromAddress).setPremiumPrice(request.fromID, request.fromAmount * _risk / 100);
        }
    }

    function requestCancel(uint256 _fromID, string calldata _flightNumber) public returns (bytes32 requestId) {
        Chainlink.Request memory req = buildChainlinkRequest(jobIdGetBool, address(this), this.fulfillCancel.selector);

        req.add("get", string.concat("https://api.flights.gabou.cool/flights/flightNumber?flightNumber=", _flightNumber));
        req.add("path", "canceled");

        bytes32 reqId = sendChainlinkRequest(req, fee);

        Request storage request = requests[reqId];
        request.fromAddress = msg.sender;
        request.fromID = _fromID;
        request.fromFlightNumber = _flightNumber;

        return reqId;
    }

    function fulfillCancel(bytes32 _requestId, bool _canceled) public recordChainlinkFulfillment(_requestId) {
        if(_canceled) {
          Request memory request = requests[_requestId];
          IDAO(request.fromAddress).setStatus(request.fromFlightNumber, _canceled);
        }
    }

    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(chainlinkTokenAddress());
        require(
            link.transfer(msg.sender, link.balanceOf(address(this))),
            "Unable to transfer"
        );
    }
}
